#include <iostream>

using namespace std;

int lengthOfLongestSubstring(string s) {
   unsigned int result = 0;
   for (unsigned int i = 0; i < s.length(); ++i) {

      unsigned int len = s.substr(i).length();
      unsigned int idx = 0;
      for (; idx < len; ++idx) {
         if (string::npos != s.substr(i,idx).find(s.substr(i)[idx])) {
            if (result < idx) {
               result = idx;
            }
            break;
         }
      }
      if (idx == len and len > result) {
         result = len;
      }
      if (result >= (s.length() - i)) {
         return result;
      }
   }
   return result;
}
